css:
.category-picker {
  margin-left: 11.25px;
}
.category-picker .menu {
  background: #f6f6f6;
}
.category-picker .menu .header-container {
  border-bottom: 0;
}
.category-picker .menu .item.selected:hover {
  background-color: #419bf9;
  color: #ffffff;
}
.category-picker .menu .item.divider {
  background-color: #e0e0e0;
  margin: 4px 0;
  height: 2px;
  padding: 0;
}
.category-picker .btn.btn-toolbar {
  margin-left: 0;
  margin-right: 0;
}
.category-picker .check-wrap {
  width: 14px;
  height: 14px;
  border-radius: 2px;
  display: inline-block;
  position: relative;
  flex-shrink: 0;
  top: 2px;
}
.category-picker img.content-mask {
  background-color: rgba(35, 31, 32, 0.8);
  position: relative;
  top: -1px;
}
.category-picker .item.selected img.content-mask {
  background-color: #ffffff;
}
.category-picker img.check-img {
  position: absolute;
}
.category-picker .category-item {
  font-size: 14px;
  display: flex;
}
.category-picker .category-create-new-tag {
  flex-shrink: 0;
}
.category-picker .category-display-name {
  display: inline-block;
  margin-left: 10px;
  margin-right: 5px;
  word-break: break-word;
}
